    false,nt"url": null,nt"notes": " American Indian tribal subdivisions are
    administrative subdivisions of federally recognized American Indiann               reservations/off-reservation
    trust lands or Oklahoma tribal statistical areas (OTSAs). These entities are internal
    units of self-governmentn               and/or administration that serve social,
    cultural, and/or economic purposes for the American Indian tribe or tribes on the
    reservations/off-reservationn               trust lands or OTSAs. The Census Bureau
    obtains the boundary and attribute information for tribal subdivisions on federally
    recognized American Indiann               reservations and off-reservation trust
    lands from federally recognized tribal governments through the Census Bureau's Boundary
    and Annexation Surveyn               (BAS) For the 2010 Census, the boundaries for
    tribal subdivisions on OTSAs were also obtained from federally recognized tribal
    governments through then               Tribal Statistical Areas Program (TSAP).
    Note that tribal subdivisions do not exist on all reservations/off-reservation trust
    lands or OTSAs, rather onlyn               where they were submitted to the Census
    Bureau by the federally recognized tribal government for that area. The boundaries
    for American Indian tribaln               subdivisions are as of January 1, 2013,
    as reported by the federally recognized tribal governments through the Census Bureau's
    Boundary and Annexationn               Survey (BAS). The boundaries for tribal subdivisions
    on OTSAs are those reported as of January 1, 2010 through TSAP.",nt"license_title":
